import React from 'react';
import GridCardItem from '../GridCardItem';
import '../../components/Works.css';

const worksList = [
    {
        title: 'dk_w_rld',
        path: '/works/00',
        label: 'development',
        src: 'images/dk_w_rld_logo1.jpg'
    },
    {
        title: 'helloworld',
        path: '/works/01',
        label: 'branding',
        src: 'images/dk_w_rld_logo2.jpg'
    },
    {
        title: 'reactmap',
        path: '/works/02',
        label: 'UX/UI',
        src: 'images/dk_w_rld_logo3.jpg'
    },
    {
        title: 'sometitle',
        path: '/works/03',
        label: 'artwork',
        src: 'images/dk_w_rld_logo4.jpg'
    },
    {
        title: 'kimchijjigea',
        path: '/works/04',
        label: 'boardgame',
        src: 'images/dk_w_rld_logo5.jpg'
    }
];

function Works() {
    return (
        <div className="works">
         <GridCardItem
            title="dk_w_rld"
            path="/works/00"
            label="development"
            src="images/dk_w_rld_logo1.jpg"></GridCardItem>
        </div>
    )
}

export default Works
